import { createApiCall } from './createApiCall.js'; // Importa la función para crear instancias de API
import { useSelector } from 'react-redux';
import { selectToken } from '../features/auth/authSlice'; // Selector para obtener el token

const apiCalls = (baseURL) => {
  const token = useSelector(selectToken);
  return createApiCall(baseURL, token);
};

export { apiCalls };
